import React from "react";
import Card from "react-bootstrap/Card";

const Book = (props) => {
    return (
        <Card className="m-5">
            <Card.Img variant="top" src="https://mymagic-central.s3.amazonaws.com/uploads/organization/thumbnail/b3c6e2018d5590331561c27f3050ce5d3998c2a3.adaptiveResize.320x320.jpg" />
            <Card.Body>
                <Card.Title>{props.book.title}</Card.Title>
                <Card.Text>{props.book.description}</Card.Text>
            </Card.Body>
        </Card>
    )
}

export default Book;
